import {Link} from "react-router-dom";
export default function Header() {
  return (
    <header>
      <Link href="/" className="logo">
        MyBlog
      </Link>
      <nav>
        <Link href="/login">Login</Link>
        <Link href="/">Register</Link>
      </nav>
    </header>
  );
}
